import React, { useEffect } from "react";
import { useDispatch, useSelector } from 'react-redux';
import { fetchLists } from "../redux/actions/listActions";
import ListMap from "../component/list_map";
import List from "../component/list";
import "../css/list_map.css";

const MyList = () => {
    const dispatch = useDispatch();
    const lists = useSelector(state => state.lists.lists);

    useEffect(() => {
        dispatch(fetchLists());
    }, [dispatch]);

    return (
        <React.Fragment>
            <div className="list_map_frame" style={{ position: "relative", width: '100%', height: '100vh' }}>
                <ListMap />
                <div style={{ position: "absolute", width: "100%", height:'' }}>
                    <List />
                </div>
            </div>
        </React.Fragment>
    )
}

export default MyList;
